import Students from "./Students";

const Comp_prac = () =>{
  let num = 1;
  const name = ['김궁서','이희태','김유진', '구상모', '김재훈','이한재','박기웅','안광현','임대훈','노태종','김영란','김진','박상현']
  const Stud = (no, name)=>[{
    no : no,
    name : name
  }];
  for(let i =0;i<name.length;i++){
    let t = Students[i,name[i]];
    Stud[i](<Students Stud={t.no}/>);
  }
  
  return(
    <div>
      <Stud/>
    </div>
  )
}

export default Comp_prac;
